    true,nt"url": null,nt"notes": "<p>2001 to 2014. The National Health Interview
    Survey (NHIS) has monitored the health of the nation since 1957. NHIS data on a
    broad range of health topics are collected through personal household interviews.
     Data for this dataset has been computed by personnel in CDC's Division for Heart
    Disease and Stroke Prevention (DHDSP).  This dataset is one of the datasets provided
    by National Cardiovascular Disease Surveillance System. The system is designed to
    integrate multiple indicators from many data sources to provide a comprehensive
    picture of the public health burden of CVDs and associated risk factors in the United
    States. The data are organized by location (national, state, county, and selected
    sites) and indicator, and they include CVDs (e.g., heart failure) and risk factors
    (e.g., hypertension). The data can be plotted as trends and stratified by age group,
    sex, and race/ethnicity.</p>n",nt"license_title": "Other License Specified",nt"extras":
